 import "DixmierOhnoInvariants.m" : DerivativeSequence,  PowerDerivative, DifferentialOperation, JOperation11, JOperation22, JOperation30, JOperation03, CovariantHessian,    ContravariantSigmaAndPsi, DixmierInvariant;

import "../toolbox/misc.m" : ChangeBaseRing, LiftRing;

function DOInvariantsChar3(F : PrimaryOnly := false, AllInvs := true, degmax := 10^6, degmin := 1)

    PF := Parent(F); x := PF.1; y := PF.2; z := PF.3;
    monF := [x^4, x^3*y, x^3*z, x^2*y^2, x^2*y*z, x^2*z^2, x*y^3, x*y^2*z,
        x*y*z^2, x*z^3, y^4, y^3*z, y^2*z^2, y*z^3, z^4];
    a40 := MonomialCoefficient(F, x^4);
    a31 := MonomialCoefficient(F, x^3*y);
    a30 := MonomialCoefficient(F, x^3*z);
    a22 := MonomialCoefficient(F, x^2*y^2);
    a21 := MonomialCoefficient(F, x^2*y*z);
    a20 := MonomialCoefficient(F, x^2*z^2);
    a13 := MonomialCoefficient(F, x*y^3);
    a12 := MonomialCoefficient(F, x*y^2*z);
    a11 := MonomialCoefficient(F, x*y*z^2);
    a10 := MonomialCoefficient(F, x*z^3);
    a04 := MonomialCoefficient(F, y^4);
    a03 := MonomialCoefficient(F, y^3*z);
    a02 := MonomialCoefficient(F, y^2*z^2);
    a01 := MonomialCoefficient(F, y*z^3);
    a00 := MonomialCoefficient(F, z^4);

    Phi := F; PolRing := BaseRing(PF); ConvFct := func<x,y|x>;
    if Characteristic(PF) ne 0 then

        PolRing := BaseRing(PF); R := LiftRing(PolRing : N := 100);

        RUVW := PolynomialRing(R, 3); U := RUVW.1; V := RUVW.2; W := RUVW.3;
        monR := [U^4, U^3*V, U^3*W, U^2*V^2, U^2*V*W, U^2*W^2, U*V^3, U*V^2*W,
            U*V*W^2, U*W^3, V^4, V^3*W, V^2*W^2, V*W^3, W^4];

        Phi := &+[ (R!ChangeBaseRing(MonomialCoefficient(F, monF[i]), R))*monR[i] : i in [1..#monF] ];

        ConvFct := ChangeBaseRing;
    end if;

    Sigma, Psi := ContravariantSigmaAndPsi(Phi);
    Rho := (1/144)*DifferentialOperation(Phi,Psi);
    He := (1/1728)*CovariantHessian(Phi);
    Tau := (1/12)*DifferentialOperation(Rho,Phi);
    Xi := (1/72)*DifferentialOperation(Sigma,He);
    Eta := (1/12)*DifferentialOperation(Xi,Sigma);
    Nu := (1/8)*DifferentialOperation(Eta,DifferentialOperation(Rho,He));

    DOs := []; WG := [];

    /*
     * Degree 3
     **********/
     if degmax lt 3 then	return DOs, WG; end if;

     // "I03...";
     I03 := 2^4  * 3^2 * DixmierInvariant(Phi,3 : IntegralNormalization := false);

     // deg. 3, aka i3
     i3 := ConvFct(I03, PolRing);
     if degmin le 3 then
         Append(~DOs, i3);  Append(~WG, 3); /* Primary */
     end if;

     /*
     * Degree 6
     **********/
     if degmax lt 6 then	return DOs, WG; end if;

     // "I06...";
     I06 := 2^12 * 3^6 * DixmierInvariant(Phi,6 : IntegralNormalization := false);
     i6  := (I03^2 + I06) / 3^2;

     // deg. 6, aka i6
     if not PrimaryOnly then
         if degmin le 6 then
             i6p := ConvFct(2*I03^2 + i6, PolRing);
             Append(~DOs, i6p);  Append(~WG, 6);
         end if;
     end if;

     // "I09...";
     I09 := 2^12 * 3^8 * JOperation11(Tau,Rho);
     i9  := (2*I03^3 + I09) / 3;

     // deg. 6, aka j6
     if not PrimaryOnly then
/*
             Kx := -1/3*I03^3 + 1/3*I09;
             j6 := ConvFct(Kx, PolRing) / i3;
*/
             j6 :=
                 a40^2*a02^4 + 2*a40*a31*a11*a02^3 + 2*a40*a30*a12*a02^3 + 2*a40*a22*a20*a02^3 +
                 a40*a21^2*a02^3 + 2*a40*a13*a11^3*a02 + 2*a40*a12^4*a00 +
                 2*a40*a12^3*a11*a01 + 2*a40*a12^3*a10*a02 + 2*a40*a12*a11^3*a03 +
                 2*a40*a11^4*a04 + a31^2*a20*a02^3 + 2*a31*a30*a21*a02^3 +
                 2*a31*a22*a11^3*a02 + 2*a31*a21*a12^3*a00 + 2*a31*a21*a11^3*a03 +
                 2*a31*a20*a12^3*a01 + 2*a31*a20*a11^3*a04 + 2*a31*a13*a11^4 +
                 2*a31*a12^3*a11*a10 + a31*a12^2*a11^3 + a30^2*a22*a02^3 +
                 2*a30*a22*a12^3*a00 + 2*a30*a22*a11^3*a03 + 2*a30*a21*a12^3*a01 +
                 2*a30*a21*a11^3*a04 + 2*a30*a20*a12^3*a02 + 2*a30*a13*a12*a11^3 +
                 2*a30*a12^4*a10 + a30*a12^3*a11^2 + a22^4*a00^2 + 2*a22^3*a21*a01*a00 +
                 2*a22^3*a20*a02*a00 + a22^3*a20*a01^2 + 2*a22^3*a12*a10*a00 +
                 a22^3*a11^2*a00 + 2*a22^3*a11*a10*a01 + a22^3*a10^2*a02 + a22^2*a11^4 +
                 2*a22*a21^3*a03*a00 + 2*a22*a21^3*a02*a01 + 2*a22*a21*a12*a11^3 +
                 2*a22*a20^3*a04*a02 + a22*a20^3*a03^2 + 2*a22*a20*a13*a11^3 +
                 2*a22*a20*a12^3*a10 + 2*a21^4*a04*a00 + 2*a21^4*a03*a01 + a21^4*a02^2 +
                 2*a21^3*a20*a04*a01 + 2*a21^3*a20*a03*a02 + 2*a21^3*a13*a12*a00 +
                 2*a21^3*a13*a11*a01 + 2*a21^3*a13*a10*a02 + a21^3*a12^2*a01 +
                 2*a21^3*a12*a11*a02 + 2*a21^3*a12*a10*a03 + a21^3*a11^2*a03 +
                 2*a21^3*a11*a10*a04 + a21^2*a13*a11^3 + a21^2*a12^3*a10 +
                 2*a21*a20^3*a04*a03 + 2*a21*a20*a12^3*a11 + a20^4*a04^2 + a20^3*a13^2*a02 +
                 2*a20^3*a13*a12*a03 + 2*a20^3*a13*a11*a04 + a20^3*a12^2*a04 + a20^2*a12^4;

         if degmin le 6 then
             Append(~DOs, j6);  Append(~WG, 6); /* Primary Bis */
         end if;
     end if;

     /*
     * Degree 9
     **********/
     if degmax lt 9 then	return DOs, WG; end if;

     // "J09...";
     J09 := 2^12 * 3^7 * JOperation11(Xi,Rho);
     j9  := (3*I03^3 + 79*i9 + J09) / 3^4;

     // deg. 9, aka i9
     if not PrimaryOnly then
         if degmin le 9 then
             j9p := ConvFct(2*I03^3 + 2*i9+j9, PolRing);
             Append(~DOs, j9p);  Append(~WG, 9);
         end if;
     end if;

     /*
     * Degree 15
     **********/
     if degmax lt 15 then return DOs, WG; end if;

     // "I12...";
     I12 := 2^16 * 3^12 * JOperation03(Rho);
     i12 := (4*I03^4 + 36*I03^2*i6 + I12) / 3^4;

     // "J12...";
     J12 := 2^17 * 3^10 * JOperation11(Tau,Eta);
     j12 := (I03*i9 + J12) / 3^2;

     // "I15...";
     I15 := 2^23 * 3^15 * JOperation30(Tau);
     i15 := (2171*I03^5 + 1116*I03^3*i6 + 2673*I03*i6^2 + 2205*I03^2*i9 + 2916*i6*i9 + 2187*I03^2*j9 + 729*i6*j9 + 1701*I03*i12 + 648*I03*j12 + I15) / 3^7;

     // "J15...";
     J15 := 2^23 * 3^12 * JOperation30(Xi);
     j15 := (229*I03^5 + 261*I03^3*i6 + 90*I03*i6^2 + 255*I03^2*i9 + 162*i6*i9 + 243*I03^2*j9 + 90*I03*i12 + 54*I03*j12 + J15) / 3^5;

     if not PrimaryOnly then

         // deg. 15, aka i15
         if degmin le 15 then
             Kx :=
                 (6*I03^5+4*I03^3*i6+5*I03^2*i9+7*I03^2*j9+7*I03*i6^2+7*I03*j12+8*i6*i9) / 3;
             i15p := ConvFct(Kx, PolRing);
             Append(~DOs, i15p);  Append(~WG, 15);
         end if;

         // deg. 15, aka j15
         if degmin le 15 then
             Kx :=
                 (6*I03^5+2*I03^3*i6+4*I03^2*i9+2*I03^2*j9+2*I03*i6^2+3*I03*i12+8*I03*j12+7*i6*i9+
                 3*i6*j9+6*i15)/ 3;
             j15p := ConvFct(Kx, PolRing);
             Append(~DOs, j15p);  Append(~WG, 15);
         end if;
     end if;

     // "I18...";
     I18 := 2^27 * 3^17 * JOperation22(Tau,Rho);
     i18 := (3685*I03^6 + 4050*I03^4*i6 + 1512*I03^2*i6^2 + 243*i6^3 + 2382*I03^3*i9 + 2700*I03*i6*i9 + 2187*i9^2 + 1944*I03^3*j9 + 1458*I03*i6*j9 + 729*i9*j9 + 702*I03^2*i12 + 1701*i6*i12 + 108*I03^2*j12 + 1944*i6*j12 + 1458*I03*j15 + I18) / 3^7;

     // "J18...";
     J18 := 2^27 * 3^15 * JOperation22(Xi,Rho);
     j18 := (230*I03^6 + 384*I03^4*i6 + 198*I03^2*i6^2 + 108*i6^3 + 179*I03^3*i9 + 336*I03*i6*i9 + 162*i9^2 + 195*I03^3*j9 + 117*I03*i6*j9 + 198*i9*j9 + 81*j9^2 + 57*I03^2*i12 + 81*i6*i12 + 15*I03^2*j12 + 27*i6*j12 + 108*I03*i15 + 90*I03*j15 +216*i18 + J18) / 3^5;

     if degmin le 15 then
         if not PrimaryOnly and AllInvs then

             // deg. 15, aka k15
             K0 :=
                 (9*I03^6+11*I03^4*i6+19*I03^3*i9+14*I03^3*j9+14*I03^2*i6^2+24*I03^2*i12+14*I03^2*
                 j12+22*I03*i6*i9+3*I03*i6*j9+21*I03*j15+21*i9*j9) / 3^2;
             K0 := ConvFct(K0, PolRing);
             K1 :=
                 (15*I03^6+14*I03^4*i6+4*I03^3*i9+17*I03^3*j9+11*I03^2*i6^2+11*I03^2*j12+22*I03*i6
                 *i9+3*I03*i6*j9+21*I03*j15+6*i9^2+21*i9*j9) / 3^2;
             K1 := ConvFct(K1, PolRing);

             k15 :=
                 (2*K0+K1) / i3;
             Append(~DOs, k15);  Append(~WG, 15);
         end if;
     end if;

     if degmax lt 18 then return DOs, WG; end if;

     if not PrimaryOnly then
         // deg. 18, aka i18
         if degmin le 18 then
             Kx :=
                 (9*I03^6+11*I03^4*i6+19*I03^3*i9+14*I03^3*j9+14*I03^2*i6^2+24*I03^2*i12+14*I03^2*
                 j12+22*I03*i6*i9+3*I03*i6*j9+21*I03*j15+21*i9*j9) / 3^2;
             i18p := ConvFct(Kx, PolRing);
             Append(~DOs, i18p);  Append(~WG, 18);
         end if;

         // deg. 18, aka j18
         if degmin le 18 then
             Kx :=
                 (5*I03^6+I03^4*i6+I03^3*i9+I03^3*j9+8*I03^2*i6^2+4*I03^2*i12+2*I03^2*j12+3*I03*i6
                 *i9+3*I03*i15+6*I03*j15+3*i6*j12+2*i9^2+6*j9^2+3*j18) / 3;
             j18p := ConvFct(Kx, PolRing);
             Append(~DOs, j18p);  Append(~WG, 18);
         end if;
     end if;

     if degmax lt 21 then return DOs, WG; end if;

     // "I21...";
     I21 := 2^31 * 3^18 * JOperation03(Eta);
     i21 :=  (179*I03^7 + 45*I03^5*i6 + 1908*I03^3*i6^2 + 1377*I03*i6^3 + 285*I03^4*i9 +
         1728*I03^2*i6*i9 + 999*i6^2*i9 + 936*I03*i9^2 + 1026*I03^4*j9 + 1620*I03^2*i6*j9
         + 486*I03*i9*j9 + 639*I03^3*i12 + 1620*I03*i6*i12 + 1161*i9*i12 + 1458*j9*i12 +
         54*I03^3*j12 + 486*I03*i6*j12 + 567*i9*j12 + 1458*j9*j12 + 972*I03^2*i15 +
         243*I03^2*j15 + I21)/3^7;

     // "J21...";
     J21 := 2^33 * 3^16 * JOperation11(Nu,Eta);
     j21 := (54*I03^7 + 26*I03^5*i6 + 153*I03^3*i6^2 + 306*I03*i6^3 + 28*I03^4*i9 +
         479*I03^2*i6*i9 + 531*i6^2*i9 + 440*I03*i9^2 + 461*I03^4*j9 + 570*I03^2*i6*j9 +
         192*I03*i9*j9 + 675*I03*j9^2 + 7*I03^3*i12 + 621*I03*i6*i12 + 486*j9*i12 +
         195*I03^3*j12 + 81*I03*i6*j12 + 162*i9*j12 + 486*j9*j12 + 333*I03^2*i15 +
         66*I03^2*j15 + 81*i6*j15 + 99*I03*i18 + 162*I03*j18 + J21) / 3^6;

     if not PrimaryOnly then
         // Kx, deg. 21
         if degmin le 21 then
             Kx :=
                 (6*I03^7+22*I03^5*i6+23*I03^4*i9+13*I03^4*j9+2*I03^3*i6^2+6*I03^3*i12+16*I03^3*
                 j12+13*I03^2*i6*i9+4*I03^2*i6*j9+22*I03*i6^3+24*I03^2*j15+6*I03*i12*i6+4*I03*i6*
                 j12+18*I03*i9^2+15*I03*i9*j9+24*I03*j9^2+8*i6^2*i9+12*i6^2*j9+18*I03*i18+18*i12*
                 i9+18*i12*j9+18*i15*i6+24*i6*j15+15*i9*j12+24*j12*j9+18*i21) / 3^2;
             i21p := ConvFct(Kx, PolRing);
             Append(~DOs, i21p);  Append(~WG, 21);
         end if;

         // Kx, deg. 21
         if degmin le 21 then
             Kx :=
                 (9*I03^7+32*I03^5*i6+70*I03^4*i9+17*I03^4*j9+5*I03^3*i6^2+78*I03^3*i12+53*I03^3*
                 j12+49*I03^2*i6*i9+18*I03^2*i6*j9+60*I03*i6^3+36*I03^2*i15+3*I03^2*j15+9*I03*i12
                 *i6+69*I03*i6*j12+45*I03*i9^2+66*I03*i9*j9+63*I03*j9^2+12*i6^2*i9+45*i6^2*j9+18*
                 I03*i18+54*I03*j18+18*i12*i9+54*i15*i6+63*i6*j15+27*i9*j12+9*j12*j9+27*j21)/3^3;
             j21p := ConvFct(Kx, PolRing);
             Append(~DOs, j21p);  Append(~WG, 21);
         end if;

         if degmax lt 24 then return DOs, WG; end if;

         // Kx, deg. 24
         if degmin le 24 then
             Kx :=
                 (63*I03^8+73*I03^6*i6+53*I03^5*i9+22*I03^5*j9+27*I03^4*i6^2+75*I03^4*i12+76*I03^4
                 *j12+30*I03^3*i6*i9+11*I03^3*i6*j9+50*I03^2*i6^3+33*I03^3*j15+48*I03^2*i12*i6+23
                 *I03^2*i6*j12+39*I03^2*i9^2+33*I03^2*i9*j9+15*I03^2*j9^2+76*I03*i6^2*i9+9*I03^2*
                 i18+72*I03^2*j18+45*I03*i12*i9+54*I03*i15*i6+48*I03*i6*j15+51*I03*i9*j12+6*I03*
                 j12*j9+36*i12*i6^2+27*i6^2*j12+60*i6*i9^2+15*i6*i9*j9+63*i12*j12+36*i15*i9+63*
                 i18*i6+63*i9*j15+63*j12^2)/3^3;
             i24 := ConvFct(Kx, PolRing);
             Append(~DOs, i24);  Append(~WG, 24);
         end if;

         // Kx, deg. 24
         if degmin le 24 then
             Kx :=
                 (6*I03^8+30*I03^6*i6+63*I03^5*i9+33*I03^5*j9+I03^4*i6^2+3*I03^4*i12+72*I03^4*j12+
                 47*I03^3*i6*i9+58*I03^3*i6*j9+46*I03^2*i6^3+27*I03^3*i15+63*I03^3*j15+69*I03^2*
                 i12*i6+64*I03^2*i6*j12+48*I03^2*i9^2+24*I03^2*i9*j9+15*I03^2*j9^2+17*I03*i6^2*i9
                 +66*I03*i6^2*j9+72*i6^4+63*I03^2*i18+72*I03^2*j18+36*I03*i12*i9+72*I03*i12*j9+63
                 *I03*i15*i6+69*I03*i6*j15+57*I03*i9*j12+6*I03*j12*j9+72*i12*i6^2+30*i6*i9^2+36*
                 i15*i9+63*i9*j15+63*j12^2) / 3^3;
             j24 := ConvFct(Kx, PolRing);
             Append(~DOs, j24);  Append(~WG, 24);
         end if;


         // Kx, deg. 24
         if degmin le 24 then
             Kx :=
                 (54*I03^8+512*I03^6*i6+703*I03^5*i9+32*I03^5*j9+471*I03^4*i6^2+618*I03^4*i12+653*
                 I03^4*j12+57*I03^3*i6*i9+679*I03^3*i6*j9+118*I03^2*i6^3+396*I03^3*i15+57*I03^3*
                 j15+267*I03^2*i12*i6+493*I03^2*i6*j12+12*I03^2*i9^2+186*I03^2*i9*j9+48*I03^2*j9^
                 2+518*I03*i6^2*i9+579*i6^4+315*I03^2*i18+99*I03^2*j18+126*I03*i12*i9+495*I03*i12
                 *j9+45*I03*i15*i6+249*I03*i6*j15+450*I03*i9*j12+243*I03*j12*j9+3*i12*i6^2+504*i6
                 ^2*j12+192*i6*i9^2+477*i6*i9*j9+486*i6*j9^2+27*I03*i21+702*I03*j21+684*i12*j12+
                 495*i15*i9+288*i18*i6+180*i9*j15+15*j12^2+648*j15*j9) / 3^5;
             k24 := ConvFct(Kx, PolRing);
             Append(~DOs, k24);  Append(~WG, 24);
         end if;end if;

         if degmax lt 27 then return DOs, WG; end if;

         // "I27...";
         I27 := 2^40 * DiscriminantOfTernaryQuartic(Phi);
         i27 := (29205*I03^9 + 136229*I03^7*i6 + 20536*I03^5*i6^2 + 176042*I03^3*i6^3 +
             108072*I03*i6^4 + 108025*I03^6*i9 + 5552*I03^4*i6*i9 + 112933*I03^2*i6^2*i9 +
             702*i6^3*i9 + 6423*I03^3*i9^2 + 72744*I03*i6*i9^2 + 147258*i9^3 + 13634*I03^6*j9
             + 123836*I03^4*i6*j9 + 86529*I03^2*i6^2*j9 + 87642*i6^3*j9 + 109131*I03^3*i9*j9
             + 102306*I03*i6*i9*j9 + 104976*i9^2*j9 + 104832*I03^3*j9^2 + 15741*I03*i6*j9^2 +
             65610*i9*j9^2 + 134865*j9^3 + 54771*I03^5*i12 + 12030*I03^3*i6*i12 +
             148131*I03*i6^2*i12 + 21204*I03^2*i9*i12 + 34506*i6*i9*i12 + 33543*I03^2*j9*i12
